eight=&quot;360&quot; width=&quot;406&quot; align=&quot;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p&gt;\r\n		&lt;p&gt;\r\n			&lt;strong&gt;&lt;br /&gt;\r\n&lt;/strong&gt;\r\n		&lt;/p&gt;\r\n		&lt;p align=&quot;left&quot;&gt;\r\n			&lt;strong&gt;应用广泛&lt;/strong&gt;&lt;br /&gt;\r\n适用于各种小型工程机械。\r\n		&lt;/p&gt;\r\n		&lt;p align=&quot;left&quot;&gt;\r\n			&lt;strong&gt;性能可靠，性价比高&lt;/strong&gt;&lt;br /&gt;\r\n功率高达110马力。故障率低，运营效率高，节约成本。\r\n		&lt;/p&gt;\r\n		&lt;p align=&quot;left&quot;&gt;\r\n			&lt;strong&gt;噪音低，更环保，燃油经济性好&lt;/strong&gt;&lt;br /&gt;\r\n采用深度刚性曲轴箱和优化加强筋设计，振动隔离式气门室盖，多种降噪选件。&lt;br /&gt;\r\n柴油直接喷射，降低热损失率，启动更迅速，降低了排放量，能够满足欧美非公路用机动设备第三阶段排放标准(Tier 3/Stage IIIA)。\r\n		&lt;/p&gt;\r\n		&lt;p align=&quot;left&quot;&gt;\r\n			&lt;strong&gt;结构紧凑，易操作，安装维护更便捷&lt;/strong&gt;&lt;strong&gt;&lt;br /&gt;\r\n&lt;/strong&gt;同等发动机构造更简洁，重量轻，安装保养更便捷。主要维护件可以布置在发动机的一侧，方便维护保养。\r\n		&lt;/p&gt;\r\n	&lt;/p&gt;\r\n&lt;/div&gt;','2016-04-05 13:26:30',NULL,1,1,'B3.3 发动机总成','B3.3 发动机总成',1),(229,'曲轴后油封 C4982415',14,'/Uploads/2018-06-20/5708bce97de8b.jpg','&lt;p&gt;\r\n	&lt;img src=&quot;/Uploads/20160409/20160409082100_21840.jpg&quot; alt=&quot;&quot; /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;p&gt;\r\n		&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;strong&gt;零件名称：&lt;/strong&gt;曲轴后油封&lt;/span&gt; \r\n	&lt;/p&gt;\r\n	&lt;p&gt;\r\n		&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;strong&gt;零件号：&amp;nbsp;&lt;/strong&gt;C4982415&lt;/span&gt; \r\n	&lt;/p&gt;\r\n&lt;/p&gt;','2016-04-09 16:27:21',NULL,1,1,'曲轴后油封 C4982415','曲轴后油封 C4982415',1),(230,'冷却喷嘴 C3959291',14,'/Uploads/2018-06-20/5708bf1b8a25b.jpg','&lt;p&gt;\r\n	&lt;img src=&quot;/Uploads/20160409/20160409083456_53876.jpg&quot; alt=&quot;&quot; /&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;strong&gt;零件名称：&lt;/strong&gt;冷却喷嘴&amp;nbsp;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;strong&gt;零件号：&lt;/strong&gt;&l