/*Table structure for table `tb_site` */

DROP TABLE IF EXISTS `tb_site`;

CREATE TABLE `tb_site` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '站点名称',
  `host` varchar(64) NOT NULL DEFAULT '' COMMENT '站点域名',
  `language` varchar(32) NOT NULL DEFAULT '' COMMENT '语言',
  `addtime` datetime DEFAULT NULL COMMENT '添加时间',
  `adduser` varchar(32) NOT NULL DEFAULT '' COMMENT '添加人',
  `remark` varchar(32) NOT NULL DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

/*Data for the table `tb_site` */

