/*Table structure for table `tb_site_menu` */

DROP TABLE IF EXISTS `tb_site_menu`;

CREATE TABLE `tb_site_menu` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `sid` int(11) NOT NULL COMMENT '站点id',
  `name` varchar(32) NOT NULL DEFAULT '' COMMENT '链接地址',
  `route` varchar(32) NOT NULL DEFAULT '' COMMENT '路由',
  `addtime` datetime DEFAULT NULL COMMENT '添加时间',
  `sort` tinyint(1) NOT NULL DEFAULT '0' COMMENT '排序 越大越靠前',
  `adduser` varchar(32) NOT NULL DEFAULT '' COMMENT '添加人',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态',
  `remark` varchar(32) NOT NULL DEFAULT '' COMMENT '备注',
  `keyword` varchar(1000) NOT NULL DEFAULT '' COMMENT '关键字',
  `description` varchar(1000) NOT NULL DEFAULT '' COMMENT '描述',
  PRIMARY KEY (`id`),
  KEY `sid` (`sid`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;

