d`,`type`,`name`,`key`,`value`,`remark`,`addtime`,`adduser`) VALUES (\'1\',\'2\',\'关于我们-配图文案\',\'WEB_ABOUT_MARK\',\'&lt;h3 class=&quot;title&quot; style=&quot;margin: 0px; padding: 0px; font-size: 20px; color: rgb(0, 54, 161); line-height: 50px; font-family: &amp;quot;microsoft yahei&amp;quot;; white-space: normal;&quot;&gt;关于我们&lt;/h3&gt;&lt;p class=&quot;exp&quot; style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;十堰星鸿机械有限公司是一家有康明斯授权的代理销售公司。&lt;/p&gt;\',\'\',\'2018-06-23 10:38:21\',\'[超级管理员]刘飞\')','127.0.0.1','2018-06-23 10:38:21'),(99,'liufei(用户ID:336)','添加站点配置成功','INSERT INTO `tb_site_config` (`sid`,`type`,`name`,`key`,`value`,`remark`,`addtime`,`adduser`) VALUES (\'1\',\'2\',\'关于我们\',\'WEB_ABOUT_MAIN\',\'&lt;p style=&quot;word-wrap: break-word; font-family: &amp;quot;sans serif&amp;quot;, tahoma, verdana, helvetica; font-size: 12px; white-space: normal;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;十堰星鸿机械有限公司&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;--康明斯授权的代理销售公司，位于堪称“东方底特律”之称的-中国湖北省十堰市。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;word-wrap: break-word; font-family: &amp;quot;sans serif&amp;quot;, tahoma, verdana, helvetica; font-size: 12px; white-space: normal;&quot;&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;word-wrap: break-word; font-family: &amp;quot;sans serif&amp;quot;, tahoma, verdana, helvetica; font-size: 12px; white-space: normal;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;优势的地理位置&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;--我公司距离武当山机场约5公里，便于您从中国的主要城市来参观我公司。从西安的咸阳机场到我公司约45分钟，从武汉天河机场到我公司仅需1个小时，从广州的白云机场到我公司只需2个小时时间。在此，我公司诚挚的欢迎各国朋友到我公司参观访问。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;word-wrap: break-word; font-family: &amp;quot;sans serif&amp;quot;, tahom